// Forward declarations
void initialize_robot(void);
void enable_motor_0(bool clockwise);
void disable_all_motors(void);
int read_sensor(int sensor);

// A function to get the absolute value of an integer
static inline int abs_int(int x) { return (x < 0) ? -x : x; }

void initialize_robot() {
  // This function sets directions of the pins and resets everything in the base
  // address by writing 1 to it
  *JP_DIR_ADDR = 0x07F557FF;
  *JP_BASE_ADDR = 0xffffffff;
}

void enable_motor_0(bool clockwise) {
  if (clockwise) {
    *JP_BASE_ADDR = 0xFFFFFFF0;  // Enable motor 0 in one direction
  } else {
    *JP_BASE_ADDR = 0xFFFFFFFA;  // Enable motor 0 in the opposite direction
  }
}

void rotateCW() {
  *JP_BASE_ADDR = 0xFFFFFFF2;  // Enables motor 0 in one direction and motor 1
                               // in the opposite direction
}
void rotateCCW() {
  *JP_BASE_ADDR = 0xFFFFFFF8;  // Enables motor 0 in one direction and motor 1
                               // in the opposite direction
}

int read_sensor(int sensor) {
  int sensor_value = 0;
  if (sensor == 0) {
    // Enable sensor 0
    *JP_BASE_ADDR = ~0x00000400;
    // Wait until sensor ready (bit 11 will become 0)
    while ((*JP_BASE_ADDR & 0x00000800) != 0);
    sensor_value = (*JP_BASE_ADDR >> 27) & 0xF;
  } else if (sensor == 1) {
    // Enable sensor 1 and also wait till sensor is ready
    *JP_BASE_ADDR = ~0x00001000;
    while ((*JP_BASE_ADDR & 0x00002000) != 0);
    sensor_value = (*JP_BASE_ADDR >> 27) & 0xF;
  }
  return sensor_value;
}

void disable_all_motors(void) {
  // Setting the everything to 1 disables everything inclkuding all motors.
  *JP_BASE_ADDR = 0xFFFFFFFF;
}

// clears the screen
void clear_screen(int erase) {
    volatile short int *one_pixel_address;
    for(int i=0; i<240; i++) {
        for(int j=0; j<320; j++) {
            one_pixel_address = pixel_buffer_start + (i << 10) + (j << 1);
			if(erase==0)
            	*one_pixel_address = background[i*320+j];
			else
            	*one_pixel_address = 0x0;
        }
    }
}

// draws a robot onto the screen
void draw_robot(int x, int y, int n, short int robot[n][n], int erase) {
	volatile short int *one_pixel_address;
	for(int i=0; i<n; i++) {
		for(int j=0; j<n; j++) {
			one_pixel_address = pixel_buffer_start + ((i+y) << 10) + ((j+x) << 1);
			short int col = robot[i][j];
			if(erase==0)
				*one_pixel_address = col;
			else if(erase == 1) {
				if((i == 0 && j == n/2) || (i == n/2 && j == 0) ||(i == n-1 && j == n/2) || (i == n/2 && j == n-1))
					*one_pixel_address = 0xFF00;
				else
					*one_pixel_address = 0x0;
			}
			else {
				if((angle == 90 || angle == 270) && j == n/2) {
					*one_pixel_address = 0xFF00;
				}
				else if((angle == 0 || angle == 180) && i == n/2) {
					*one_pixel_address = 0xFF00;
				}
				else {
					*one_pixel_address = 0x0;
				}
			}
		}
	}
}

// waits for vertical sync on screen
void wait_for_vsync(int play_music) {
  volatile int *pixel_ctrl_ptr = (int *)0xff203020;  // base address
  int status;
  *pixel_ctrl_ptr = 1;  // start the synchronization process
  // - write 1 into front buffer address register
  status = *(pixel_ctrl_ptr + 3);  // read the status register
  while ((status & 0x01) != 0) {
    status = *(pixel_ctrl_ptr + 3);
    if(play_music == 1) {
      if(audio->wslc > 0 && audio->wsrc>0) {
        audio->ldata = audio_samples[i];
        audio->rdata = audio_samples[i];
        i++;
        if(i==num_samples) {
          i = 0;
        }
      }
    }
  }
}

// rotate image of robot
void rotate(int n, int angle, short int robot[n][n], short int out[n][n]) {
	for(int i=0; i<n; i++) {
		for(int j=0; j<n; j++) {
			if(angle == 180 || angle == 360)
				out[i][j] = rob_img[i*n+j];
			else if(angle == 90)
				out[n-j-1][i] = robot[i][j];
			else
				out[j][n-i-1] = rob_img[i*n+j];
		}
	}
}

void delay(int n, int play_music) {
	for(int i=0; i<n; i++) {
		wait_for_vsync(play_music);
	}
}

// Main function
int main() {
  initialize_robot();
  printf("Robot initialized\n");

  // This is the pulse width modulation period. We can experiment around with
  // its value but essentially how it works is that the larger it is, the more
  // time the motor will be on. The smaller it is, the less time the motor will
  // be on. We need a good balance. Empirically, I found 100k to be good number.
  const int PWM_PERIOD = 100000;

  // Shorter delay for key override mode.
  const int OVERRIDE_DELAY = 10000;

  volatile int * pixel_ctrl_ptr = (int *)0xFF203020;
  /* Read location of the pixel buffer from the pixel buffer controller */
  pixel_buffer_start = *pixel_ctrl_ptr;

  clear_screen(0);
  int n=32;
  int x = 320/2 - n;
  int y = 240/2 - n;
  int forward_x = 1, back_x = -1, forward_y = 0, back_y = 0;
  short int robot[n][n];
  short int music[n/2][n/2];
  short int robottrail[n][n];
  short int left[n][n];
  short int right[n][n];
  for(int i=0; i<n; i++) {
	for(int j=0; j<n; j++) {
		robot[i][j] = rob_img[i*32+j];
		left[i][j] = rob_tiltleft[i*32+j];
		right[i][j] = rob_tiltright[i*32+j];
	}
  }
  for(int i=0; i<n/2; i++) {
  	for(int j=0; j<n/2; j++) {
		music[i][j] = musicnote[i*16+j];
	}
  }
  int k=0;
  draw_robot(x, y, n, robot, 0);

  while (1) {
    uint32_t key_val = KEY_DATA_REG;
    bool key0_pressed = (key_val & 0x1);
    bool key1_pressed = (key_val & 0x2);
    bool key2_pressed = (key_val & 0x4);
    bool key3_pressed = (key_val & 0x8);
    
    if(k == -1) {
	clear_screen(1);
	wait_for_vsync(0);
	draw_robot(x, y, n, robot, 0);
	k = 1;
	angle = 0;
   }

    // Override mode: if a key is pressed, bypass balancing control.
    if (key0_pressed) {
      // Key0 pressed: move right (rotate motor clockwise)
      enable_motor_0(true);
      // A simple PWM-like delay cycle in override mode.
      //for (volatile int i = 0; i < OVERRIDE_DELAY; i++);
      //disable_all_motors();
      if(k==0) {
				clear_screen(1);
				k = 1;
			}
			else
				draw_robot(x, y, n, robot, 1);
			x += forward_x;
			y += forward_y;
			draw_robot(x, y, n, robot, 0);
			wait_for_vsync(0);
      if(x + n >= 320) {
        draw_robot(x, y, n, robot, 1);
        x = 0;
      }
      else if(x <= 0) {
        draw_robot(x, y, n, robot, 1);
        x = 320 - n -1;
      }
      else if(y + n >= 240) {
        draw_robot(x, y, n, robot, 1);
        y = 0;
      }
      else if(y <= 0) {
        draw_robot(x, y, n, robot, 1);
        y = 240 - n - 1;
      }
      continue;  // Check key status again in the next iteration.
    } else if (key1_pressed) {
      // Key1 pressed: move left (rotate motor counter-clockwise)
      enable_motor_0(false);
      //for (volatile int i = 0; i < OVERRIDE_DELAY; i++);
      //disable_all_motors();
      if(k==0) {
				clear_screen(1);
				k = 1;
			}
			else
				draw_robot(x, y, n, robot, 1);
			x += back_x;
			y += back_y;
			draw_robot(x, y, n, robot, 0);
			wait_for_vsync(0);
      if(x + n >= 320) {
        draw_robot(x, y, n, robot, 1);
        x = 0;
      }
      else if(x <= 0) {
        draw_robot(x, y, n, robot, 1);
        x = 320 - n -1;
      }
      else if(y + n >= 240) {
        draw_robot(x, y, n, robot, 1);
        y = 0;
      }
      else if(y <= 0) {
        draw_robot(x, y, n, robot, 1);
        y = 240 - n - 1;
      }
      continue;
    } else if (key2_pressed) {
      rotateCW();
      //for (volatile int i = 0; i < OVERRIDE_DELAY; i++);
      //disable_all_motors();
      angle += 90;
			draw_robot(x, y, n, robot, 1);
			short int out[n][n];
			rotate(n, angle, robot, out);
			draw_robot(x, y, n, out, 0);
			for(int i=0; i<n; i++)
				for(int j=0; j<n; j++)
					robot[i][j] = out[i][j];
			wait_for_vsync(0);
			delay(20, 0);
			if(angle == 90) {
				forward_x = 0;
				back_x = 0;
				forward_y = -1;
				back_y = 1;
			}
			else if(angle == 180) {
				forward_x = -1;
				back_x = 1;
				forward_y = 0;
				back_y = 0;
			}
			else if(angle == 270) {
				forward_x = 0;
				back_x = 0;
				forward_y = 1;
				back_y = -1;
			}
			else if(angle == 360) {
				forward_x = 1;
				back_x = -1;
				forward_y = 0;
				back_y = 0;
				angle = 0;
			}
      if(x + n >= 320) {
        draw_robot(x, y, n, robot, 1);
        x = 0;
      }
      else if(x <= 0) {
        draw_robot(x, y, n, robot, 1);
        x = 320 - n -1;
      }
      else if(y + n >= 240) {
        draw_robot(x, y, n, robot, 1);
        y = 0;
      }
      else if(y <= 0) {
        draw_robot(x, y, n, robot, 1);
        y = 240 - n - 1;
      }
    // } else if (key3_pressed) {
      // rotateCCW();
      // for (volatile int i = 0; i < OVERRIDE_DELAY; i++);
      // disable_all_motors();
    } else if (key3_pressed) {
        // When the switch is on, the robot will start performing its dance
        // routine. This involves constantly playing the audio file. While the
        // audio is playing, the robot vibrates left/right, ie by rotating CW
        // until sensor hits the ground, then rotating CCW until other sensor
        // hits the ground. It does this for like 2 seconds. Then it rotates for
        // 0.5 seconds. Then does the wobble again. And it continues until the
        // switch is returned back to 0.

	  k = -1;
	  clear_screen(1);
	  x = 320/2 - n;
	  y = 240/2 - n;   
          enable_motor_0(true);
          draw_robot(x, y, n, robot, 0);
	  draw_robot(x-n/2-1, y-n/2-1, n/2, music, 0);
	  draw_robot(x+n, y+n, n/2, music, 0);
	  delay(10, 1);
          //for (volatile int i = 0; i < 2000000; i++);
          disable_all_motors();
          draw_robot(x, y, n, left, 0);
          delay(10, 1);
          draw_robot(x, y, n, left, 0);
          delay(10, 1);
          
          //for (volatile int i = 0; i < 2000000; i++);
          rotateCW();
          angle = 0;
	  while(angle < 360) {
	      	angle += 90;
		short int out[n][n];
		rotate(n, angle, robot, out);
		draw_robot(x, y, n, out, 0);
		delay(10, 1);
	  }
          //for (volatile int i = 0; i < 5000000; i++);
          disable_all_motors();
          draw_robot(x, y, n, left, 0);
          enable_motor_0(false);
          delay(10, 1);
          draw_robot(x, y, n, left, 0);
          delay(10, 1);
          //for (volatile int i = 0; i < 2000000; i++);
          enable_motor_0(false);
          for (volatile int i = 0; i < 2000000; i++);
         
       
         disable_all_motors();
      }  else {
      // Read both sensors
      int ls0 = read_sensor(0);
      int ls1 = read_sensor(1);

      // Determine which direction to rotate (CW or CCW) from the sign of (s1 -
      // s0)
      int diff = ls1 - ls0;
      bool direction = (diff < 0);    // if s1 > s0, rotate CW
      int magnitude = abs_int(diff);  // magnitude of difference

      // Calculate the duty cycle (0.0 to 1.0) based on magnitude. The
      // longer/bigger the duty cycle, the more time the motor will be on. The
      // shorter/smaller the duty cycle, the less time the motor will be on.
      float dutyCycle = magnitude / 8.0f;
      if (dutyCycle > 1.0f) {
        dutyCycle = 1.0f;
      }

      // If difference is effectively zero then disable the motor
      if (magnitude == 0) {
        disable_all_motors();
      } else {
        // Turn motor on for duty cycle portion of the period
        enable_motor_0(direction);
        int onTime = (int)(dutyCycle * PWM_PERIOD);
        for (volatile int i = 0; i < onTime; i++) {
          // software based delay
        }

        // Turn motor off for the remaining portion
        int offTime = PWM_PERIOD - onTime;
        disable_all_motors();
        for (volatile int i = 0; i < offTime; i++) {
          // software based delay
        }
      }
    }
    disable_all_motors();
  }

  return 0;
}


